import { InputIconModule } from 'primeng/inputicon';
import { InputTextModule } from 'primeng/inputtext';
import { Facet } from '../../providers/search';
import { FacetCountPipe } from '../../utils/facet-count.pipe';
import {NgFor} from '@angular/common';

@Component({
  selector: 'app-search-bar',
  standalone: true,
  imports: [
    DropdownModule,
    FormsModule,
    IconFieldModule,
    InputIconModule,
    InputTextModule,
    MatToolbarModule,
    FacetCountPipe,
    NgFor
  ],
  templateUrl: './search-bar.component.html',
  styleUrl: './search-bar.component.scss',
})
export class SearchBarComponent{
  @Input({transform: trimString}) query = '';
  @Input() facets?: Facet[] = [];
  @Output() queryChange = new EventEmitter<string>();
  @Output() onSearch = new EventEmitter<string>();

  onSearchClick() {
    let query = trimString(this.query);
    if (query === '') {
      return;
    }
    this.query = query;
    this.onSearch.emit(query);
  }
}

function trimString(value: string | undefined) {
  return value?.trim() ?? '';
}

import { Component, Input, Output, EventEmitter } from '@angular/core';
import { SearchResult, Document } from '../../providers/search';
import { DataViewModule } from 'primeng/dataview';
import { DataViewPageEvent } from 'primeng/dataview';
import { NgFor } from '@angular/common';

@Component({
  selector: 'app-search-results',
  standalone: true,
  imports: [DataViewModule, NgFor],
  templateUrl: './search-results.component.html',
  styleUrl: './search-results.component.scss',
})
export class SearchResultsComponent {
  @Input() result?: SearchResult;
  @Input() rows: number = 20;
  @Input() page: number = 1;
  @Output() onPageChange = new EventEmitter<number>();

  get totalRecords(): number {
    return this.result?.found || 0;
  }

  get hits(): Document[] {
    return this.result?.hits || [];
  }

  get first(): number {
    return Math.max((this.page - 1) * this.rows, 0);
  }

  onPage(event: DataViewPageEvent) {
    this.onPageChange.emit(Math.floor(event.first / event.rows) + 1);
  }
}

